from typing import List

class Solution:
    def dailyTemperatures(self, temperatures: List[int]) -> List[int]:
        if not temperatures:
            return []
        
        count = 0
        res = []
        i = 0
        j = 0
        while i < len(temperatures) - 1 and j != len(temperatures):
            if j == len(temperatures) - 1:
                res.append(0)
                i += 1
                j = i
                count = 0
            elif temperatures[j + 1] > temperatures[i]:
                i += 1
                j += 1
                count += 1
                res.append(count)
                count = 0
                j = i
            else:
                j += 1
                count += 1

        res.append(0)
        return res

